import "./landing.css";
import React from "react";
import NavBar from  "../navbar/navbar.js";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";
import Stack from '@mui/material/Stack';
import MapSvg from '../media/svgs/mapsvg';
/*** GLobal Constants ***/
const project = (title, category, color, link) => {return {'title': title, 'category': category, 'color': color, 'link': link,}}

function Landing() {
  const images = require.context('../media/images', true);
  const drawings = [];
  const projects = [project("Project 1", "Category", "green", "/"),
                    project("Project 2", "Category", "purple", "/"),
                    project("Project 3", "Category", "orange", "/"),
                    project("Project 4", "Category", "red", "/"),
                    project("Project 5", "Category", "blue", "/")];

  for (let imgNum = 0; imgNum < 6; imgNum++) drawings.push(images(`./drawings/pic${imgNum}.png`));

  return (
    <>
    <div id="root" className=" width-100 flex column align-center">
        <div id="intro" className="appear-animation flex justify-between align-self-start width-100 height-60vw blue">
          <NavBar color="#fff"/>
          <div className="black profile-text flex column">
            <p className="heavy margin-0" style={{fontSize: "120px"}}>HELLO</p>
            <p className="extrabold margin-0" style={{fontSize: "80px"}}>I am Ahmed Katary</p>
            <p className="bold margin-0" style={{fontSize: "48px"}}>Computer Scientist | Artist</p>
            <p className="regular margin-0" style={{fontSize: "45px"}}>Welcome to my slice of the web!</p>
          </div>
        </div>

        <div class="width-100 flex justify-end">
          <div class="margin-right-40px box-shadow project-box" style={{width: "24vw", height: "16vw"}}>
              <div class="square-300 profile-image"></div>
          </div>
        </div>
        {/** Projects **/}

        {/** Research **/}

        {/** Art **/}
        <p className="font-3-5vw bold black margin-30px align-self-start">Art Gallery</p>
        <Stack direction="horizontal" className="width-100 slideshow scroll appear-animation">
          {drawings.length > 0 ?
            drawings.map((item, index) => {
                return (<img className="box-shadow margin-5px enlarge image" src={item.default} alt=""/>);
                }) :  <></>}
        </Stack>
        {/** Projects/Research **/}


        {/** Papers / Publications **/}


        {/** Education / Work **/}


        {/** Group Three: Travel **/}


        {/** Group Four: Contact **/}

        {/* <Footer /> */}
      </div>
    </>
  );
}

export default Landing;
